d89474bc3406c14f4c24d3ce1f9cfcc4.query:
query HomeHomeQuery {
  allCategories {
    ...HomeHomeRelay_data
    id
  }
}

fragment HomeHomeRelay_data on Category {
  id
  ...HomeCategoryRelay_data
}

fragment HomeCategoryRelay_data on Category {
  id
  title
}

276ef90123085e7ed55e5ed9b826bc0b.query:
query HomeCategoryNewsQuery(
  $id: String!
) {
  categoryById(id: $id) {
    ...HomeCategoryNewsRelay_data
    id
  }
}

fragment HomeCategoryNewsRelay_data on Category {
  news(first: 10) {
    edges {
      node {
        id
        ...NewsDesignDesign1Relay_data
      }
    }
  }
}

fragment NewsDesignDesign1Relay_data on News {
  title
  sourceName
  abstract
  link
}

28e5fbe221fa83329c7aca82ca7151b7.query:
query NewsSingleNewsQuery(
  $id: String!
) {
  newsById(id: $id) {
    ...NewsSingleNewsRelay_data
    id
  }
}

fragment NewsSingleNewsRelay_data on News {
  id
  title
  image
  content
  sourceUrl
  sourceName
  tagsTitle
  categoriesTitle
  pubDate
}
